import math

def find_min_secret_value_permutation(n):
    width = int(math.sqrt(n))
    start = n - width - 1
    ans = []
    while True:
        stop = False
        for v in range(start, start + width):
            if v > 0:
                ans.append(v)
            if v < 1:
                stop = True
        start -= width
        if stop:
            break
    return ans

